【サイズ】約9×6．5×2cm <br>
【材質】ABS樹脂<br>
表示方法：液晶デジタル4桁<br>
アラーム鳴動時間：約1分間<br>
最大セット時間 ：99分59秒<br>
カウントアップ最大計測時間：99分59秒<br>
動作温度範囲：0～40℃<br>
電池寿命：約1年間（1日30秒アラームをならした場合）<br>
使用電池：アルカリボタン電池LR44×1個 <br>
中国製<br><br>


ねこ型のかわいらしいキッチンタイマーです。<br>
強力磁石が2つ付いており、しっぽに輪ゴムがかけられるので冷蔵庫やシンク周りなどのキッチンまわりにいかがでしょう。<br>
操作も簡単で手軽に使用できます。 <br><br>

本商品はネオジム磁石を使用しています。<br>
心臓ペースメーカー等の体内植込型医療電子機器を装着している方は、製品を胸ポケットに入れるなどして体に密着した状態での長時間の使用を避けて下さい。<br> <br>


【ご確認事項】<br>
※曲がり具合やサイズに若干の違いが生じる場合があります。<br>
※加工段階での多少の汚れ・スレ・色ムラ・磨きキズや凹み・折り曲げ加工の微細なズレ・歪みがある場合もございます。<br>
メーカーより“良品”として販売されております。ご理解頂きご注文をお願い致します。<br><br>

<br><hr><br>

※イメージ写真の商品はセット品ではありません。<br>
<br>
※実際のお色と多少異なる事があります。<br>
<br>
区分：バラエティ<br><br>

